using System;
using System.IO;
using OfficeOpenXml;

public static class Snippet
{
	public static OfficeOpenXml.ExcelPackage func(System.String myFilename)
	{
		FileInfo fs = new FileInfo (myFilename);
		ExcelPackage pck = new ExcelPackage (fs);
		return pck;			

	}

}

using System;
using OfficeOpenXml;

public static class Snippet
{
	public static OfficeOpenXml.ExcelWorksheet func(OfficeOpenXml.ExcelPackage myExcelPackage, System.String mySheet)
	{
		ExcelWorksheet myWorksheet = myExcelPackage.Workbook.Worksheets[mySheet];
		myWorksheet.Select();
		return myWorksheet;

	}

}

using System;
using OfficeOpenXml;

public static class Snippet
{
	public static System.String func(OfficeOpenXml.ExcelWorksheet myExcelWorksheet, System.Int16 myColumnNo, System.Int16 myRowNo, System.String myCellName)
	{
		return myExcelWorksheet.Cells[myRowNo,myColumnNo].Text;

	}

}
